using namespace Selene;


//-----------------------------------------------------------------------------------
// DEFINE
//-----------------------------------------------------------------------------------
#define ARCTAN_TABLE_SIZE		(ANGLE_MAX >> 3)										///< アークタンジェントテーブルのサイズ
#define ARCTAN_POS_1			(ARCTAN_TABLE_SIZE << 1)								///< アークタンジェントの第１象限
#define ARCTAN_POS_2			(ARCTAN_POS_1 + ARCTAN_POS_1)							///< アークタンジェントの第２象限
#define ARCTAN_POS_3			(ARCTAN_POS_1 + ARCTAN_POS_2)							///< アークタンジェントの第３象限
#define ARCTAN_POS_4			(ARCTAN_POS_1 + ARCTAN_POS_3)							///< アークタンジェントの第４象限
#define ARCTAN_POS_SHIFT		(ANGLE_TABLE_BIT - 3)									///< アークタンジェントの位置シフト量
#define ARCTAN_SCALE(V)			(toF(V) * toF(1 << ARCTAN_POS_SHIFT))					///< アークタンジェントの拡大率


//-----------------------------------------------------------------------------------
// VARIABLE
//-----------------------------------------------------------------------------------
extern Uint32 g_fArcTanTable[];
extern Float g_fSinTable[];


//-----------------------------------------------------------------------------------
/**
*/
//-----------------------------------------------------------------------------------
Float Selene::Math::Sin( Sint32 Angle )
{
	return g_fSinTable[NORMALIZE_ANGLE(Angle)];
}

//-----------------------------------------------------------------------------------
/**
*/
//-----------------------------------------------------------------------------------
Float Selene::Math::Cos( Sint32 Angle )
{
	Angle += ANGLE_MAX >> 2;
	return g_fSinTable[NORMALIZE_ANGLE(Angle)];
}

//-----------------------------------------------------------------------------------
/**
*/
//-----------------------------------------------------------------------------------
Sint32 Selene::Math::ATan2( Float Dx, Float Dy )
{
	//=================================================
	// xが0の時
	//=================================================
	if ( Dx == 0 )
	{
		if ( Dy < 0 )
		{
			return ARCTAN_POS_3;
		}
		else
		{
			return ARCTAN_POS_1;
		}
	}
	//=================================================
	// yが0の時
	//=================================================
	if ( Dy == 0 )
	{
		if ( Dx < 0 )
		{
			return ARCTAN_POS_2;
		}
		else
		{
			return 0;
		}
	}

	//=================================================
	// xがマイナス(第2/3象限)
	//=================================================
	if ( Dx < 0 )
	{
		Dx = -Dx;
		//=================================================
		// yがマイナス(第3象限)
		//=================================================
		if ( Dy < 0 )
		{
			Dy = -Dy;
			//=================================================
			// 180〜224度
			//=================================================
			if ( Dx >= Dy )	
			{
				return ARCTAN_POS_2 + g_fArcTanTable[toI(ARCTAN_SCALE(Dy) / Dx)];
			}
			//=================================================
			// 225〜270度
			//=================================================
			else
			{
				return ARCTAN_POS_3 - g_fArcTanTable[toI(ARCTAN_SCALE(Dx) / Dy)];
			}
		}
		//=================================================
		// yがプラス(第2象限)
		//=================================================
		else
		{
			//=================================================
			// 136〜180度
			//=================================================
			if ( Dx >= Dy )	
			{
				return ARCTAN_POS_2 - g_fArcTanTable[toI(ARCTAN_SCALE(Dy) / Dx)];
			}
			//=================================================
			// 90〜135度
			//=================================================
			else						
			{
				return ARCTAN_POS_1 + g_fArcTanTable[toI(ARCTAN_SCALE(Dx) / Dy)];
			}
		}
	}
	//=================================================
	// xがプラス(第1/4象限)
	//=================================================
	else
	{
		//=================================================
		// yがマイナス(第4象限)
		//=================================================
		if ( Dy < 0 )
		{
			Dy = -Dy;
			//=================================================
			// 315〜360度
			//=================================================
			if ( Dx >= Dy )	
			{
				return ARCTAN_POS_4 - g_fArcTanTable[toI(ARCTAN_SCALE(Dy) / Dx)];
			}
			//=================================================
			// 180〜224度
			//=================================================
			else
			{
				return ARCTAN_POS_3 + g_fArcTanTable[toI(ARCTAN_SCALE(Dx) / Dy)];
			}
		}
		//=================================================
		// yがプラス(第1象限)
		//=================================================
		else
		{
			//=================================================
			// 0〜45度
			//=================================================
			if ( Dx >= Dy )
			{
				return g_fArcTanTable[toI(ARCTAN_SCALE(Dy) / Dx)];
			}
			//=================================================
			// 45〜90度
			//=================================================
			else
			{
				return ARCTAN_POS_1 - g_fArcTanTable[toI(ARCTAN_SCALE(Dx) / Dy)];
			}
		}
	}
}

